import linkedin from './linkedin-logo.png'
function SocialNetwork(){
   
    return(
        <>
            <div className="row display-5 justify-content-center">
                You can reach me here :)
            </div>
            <div className="row">
                <div className="card-group">
                    <div className="card">
                        <img src={linkedin} className="img-top img-fluid" style={{width:"10vh"}}></img>
                    </div>
                    <div className="card">

                    </div>
                </div>
            </div>
        </>
    );
   
}

export default SocialNetwork;
